import React, { Fragment } from 'react';
import { connect } from 'react-redux';
import { logout } from '../../actions/auth';
import PropTypes from 'prop-types';
import './general.css';

const Navbar = ({ auth: { isAuthenticated, loading, user }, logout }) => {
  // Add class to change login to logout
  const authLinks = (
    <ul className="nav navbar-nav navbar-right">
      <li id="home"><a className="nav-item" href="/">Home</a></li>
      <li id="contact"><a href="/contact">Contact Us</a></li>
      <li id="tests"><a href="/tests">Result History</a></li>
      {user && <li id="userImg"><img src={user.avatar} alt={user.name} width="50" height="50"/></li>}
      {user && <li id="logout"><a onClick={logout} href="/">{user.name} - Log Out</a></li>}
    </ul>
  );


  const guestLinks = (
    <ul className="nav navbar-nav navbar-right">
      <li id="home"><a href="/">Home</a></li>
      <li id="contact"><a href="/contact">Contact Us</a></li>
      <li id="login"><a href="/login">Log In</a></li>
    </ul>
  );

  return (
    <nav className="navbar navbar-default">
      <div className="container">
        <div className="navbar-header">
          <p className="navbar-brand">Crescentech</p>
        </div>
        {!loading && (<Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>)}
      </div>
    </nav>
  );
};

Navbar.propTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  user: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  user: state.user
});

export default connect(mapStateToProps, { logout })(Navbar);
